import logo from "../../assests/logo.jpg";

const Footer_div = () => {
  return (
    <div className="flex bg-[#2b2f32] text-[#ffffff] py-4 w-full h-[400px] justify-between mx-auto px-5 ">
      <div className="flex mx-auto w-[1180px] justify-between">
        <div className="flex flex-col gap-2">
          <span className="py-2">BURAQSYS STUDIO (PVT) LIMITED</span>
          <img
            src={logo}
            alt="logo"
            className="w-[100px] max-h-[100px] rounded-full object-contain"
          />
          <span className="text-[28px] text-[">Pakistan</span>
          <span>54/A Street 14, Cavlary Ground, Lahore</span>

          <span>+92-0301-6860000</span>
          <span>+92-0300-4436171</span>
          <span>+92-0333-4315872</span>
          <span>buraqsysstudio@gmail.com</span>
          <span>Canada</span>
          <span>Calgary, Alberta , Canada</span>
        </div>
        <div className="flex flex-col">
          <span>We Design, We Develop</span>
          <span>Ready to create the next big thing?</span>
          <span>Connect with us</span>
          //icons
        </div>
      </div>
    </div>
  );
};

export default Footer_div;
